## Create Tooltip Context

First, we need to create a context for the Tooltip component. We can do this by creating a new file called TooltipContext.js in the context folder.
```
// context/TooltipContext.js
import { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const useTooltip = () => useContext(TooltipContext);

export const TooltipProvider = ({ children }) => {
  const [tooltipOpen, setTooltipOpen] = useState(false);

  const openTooltip = () => {
    setTooltipOpen(true);
  };

  const closeTooltip = () => {
    setTooltipOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ tooltipOpen, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
In this file, we create a new context called TooltipContext using the createContext function from React. We also create a custom hook called useTooltip that uses the useContext hook to access the TooltipContext .

We then create a TooltipProvider component that wraps the children components and provides the tooltipOpen state and the openTooltip and closeTooltip functions to the TooltipContext .

## Wrap the App with the TooltipProvider

Next, we need to wrap our entire application with the TooltipProvider component. We can do this in the _app.js file.
```
// pages/_app.js
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```
## Create the Tooltip Component

Now, we can create the Tooltip component that uses the TooltipContext to manage its state.
```
// components/Tooltip.js
import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ children, content }) => {
  const { tooltipOpen, openTooltip, closeTooltip } = useTooltip();

  return (
    <div className="relative">
      <div onMouseEnter={openTooltip} onMouseLeave={closeTooltip}>
        {children}
      </div>
      {tooltipOpen && (
        <div className="absolute z-10 bg-gray-700 text-white px-4 py-2 rounded">
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
In this component, we use the useTooltip hook to access the tooltipOpen state and the openTooltip and closeTooltip functions from the TooltipContext .

We render the children prop as the trigger element for the tooltip. When the mouse enters the trigger element, we call the openTooltip function to set the tooltipOpen state to true . When the mouse leaves the trigger element, we call the closeTooltip function to set the tooltipOpen state to false .

If the tooltipOpen state is true , we render the tooltip content in an absolutely positioned div .

