up vote 3 down vote accepted There are a number of optimization techniques that compilers use. Some of the more common ones are:
Constant Folding
This is the process of evaluating constant expressions at compile time, rather than running the computation at runtime. For example, the expression
int result = 2 + 3 * 4;
Could be optimized to
int result = 14;
Since the expression 2 + 3 * 4 can be evaluated by the compiler.
Loop Unrolling
Many compilers can optimize loops by unrolling them. For example, this loop:
for (int i = 0; i < 3; ++i) {
    array[i] = i * i;
Could be unrolled to
array[0] = 0;
array[1] = 1;
array[2] = 4;
This can be faster than using a loop.
Dead Code Elimination
Many compilers can detect code that will never be executed (called "dead code") and can remove it from the final executable. For example:
int test() {
    return 0;  /* This makes the next line "dead code" */
    printf("This code will never be reached!\n");
Here, the call to printf will never be executed, and the compiler can eliminate it from the program.
Function Inlining
Many compilers can take functions and inline them directly into the calling code rather than generating a function call. For example:
inline int myFunction(int x) {
    return x + 1;
int main() {
    int result = myFunction(42);
Here, the call to myFunction could be inlined to produce this equivalent code:
int main() {
    int result = 42 + 1;
This can be faster than making a function call, but increases code size.
These are just a few of the many optimizations that compilers can make. To learn more about this, I would suggest looking at a good compiler textbook. Many of the standard techniques are documented in these texts.
