To pack and unpack an array of entities with the given fields (id: 4 bits, size: 3 bits) into an ArrayBuffer, you can use bitwise operations to store the data compactly. Here's an example implementation:

```javascript
function packEntities(entities) {
  const numEntities = entities.length;
  const bufferSize = Math.ceil((numEntities * 7) / 8);
  const buffer = new ArrayBuffer(bufferSize);
  const view = new Uint8Array(buffer);

  let offset = 0;
  let currentByte = 0;
  let bitsUsed = 0;

  for (let i = 0; i < numEntities; i++) {
    const entity = entities[i];
    const id = entity.id & 0xf; // Ensure id is within 4 bits
    const size = entity.size & 0x7; // Ensure size is within 3 bits

    // Pack id and size into the current byte
    currentByte |= (id << bitsUsed);
    bitsUsed += 4;

    if (bitsUsed === 8) {
      view[offset++] = currentByte;
      currentByte = 0;
      bitsUsed = 0;
    }

    currentByte |= (size << bitsUsed);
    bitsUsed += 3;

    if (bitsUsed === 8) {
      view[offset++] = currentByte;
      currentByte = 0;
      bitsUsed = 0;
    }
  }

  // Write the remaining bits if any
  if (bitsUsed > 0) {
    view[offset] = currentByte;
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new Uint8Array(buffer);
  const numEntities = Math.floor((buffer.byteLength * 8) / 7);
  const entities = [];

  let offset = 0;
  let currentByte = 0;
  let bitsUsed = 0;

  for (let i = 0; i < numEntities; i++) {
    let id, size;

    if (bitsUsed === 0) {
      currentByte = view[offset++];
    }

    id = (currentByte >> bitsUsed) & 0xf;
    bitsUsed += 4;

    if (bitsUsed === 8) {
      currentByte = view[offset++];
      bitsUsed = 0;
    }

    size = (currentByte >> bitsUsed) & 0x7;
    bitsUsed += 3;

    if (bitsUsed === 8) {
      currentByte = view[offset++];
      bitsUsed = 0;
    }

    entities.push({ id, size });
  }

  return entities;
}
```

