1. We calculate the required buffer size based on the number of entities and the number of bits needed per entity (4 bits for id and 3 bits for size).
2. We create an ArrayBuffer of the calculated size and a Uint8Array view to write the data.
3. We iterate over the entities and pack the id and size into the current byte using bitwise operations.
4. Whenever a byte is fully packed (8 bits used), we write it to the buffer and reset the current byte and bits used.
